<script language="JavaScript">

		var str = new String();

		function setObject(x) {
			str = x;
		}
		function getObject() {
			return str;
		}
		function frameResize() {
			w = document.getElementById("tree").offsetWidth;
			h = document.getElementById("tree").offsetHeight;
			parent.data.getZoomManager().overviewResize(w, h);
		}
				
		setObject("noObject");
			
</script>

	</FRAMESET>
	<FRAMESET cols="*,70%">

		</FRAMESET>

</FRAMESET>
